Expand description

An integer that is known not to equal zero.

This enables some memory layout optimization. For example, `Option<NonZeroU8>` is the same size as `u8`:

```
use std::mem::size_of;
assert_eq!(size_of::<Option<core::num::NonZeroU8>>(), size_of::<u8>());
```

